INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 3.18, 4, 10, 1, "フフ、全問正解よ！\nちゃんと勉強してるみたいで\n感心だわ♪", 11300101, 8, 7, 1, 3001, 1, "vo_minigame_1012_result_1000");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 3.33, 10, 10, 1, "すごいじゃない…全問正解よ！\nま、当然といや当然よね～\nだってあたしが\n教えてやってんだから♪", 11300102, 7, 8, 1, 3001, 1, "vo_minigame_1012_result_1001");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 5.41, 10, 10, 1, "全問正解！　パチパチパチ～♪\nこの難易度はもう完璧じゃない？\n次はもっと難しい問題に挑戦よ！\nあんたならできるって！", 11300103, 1, 8, 1, 3001, 1, "vo_minigame_1012_result_1002");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 8.11, 10, 10, 1, "へえ…難しい問題を選んだのに\n全問正解できてるじゃない！！\nちょっとあんたすごすぎだわ…！\nパーフェクトよパーフェクト！", 11300104, 8, 5, 1, 3001, 2, "vo_minigame_1012_result_1003");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 1.31, 0, 10, 1, "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！", 11300105, 5, 10, 1, 3001, 2, "vo_minigame_1012_result_1004");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 4.93, 0, 10, 1, "ここまで完璧に正解されちゃうと\nちょっと悔しいわね…！\nけど素直に褒めてやるわ！\nえらい、えらい、えら～い！", 11300106, 8, 9, 1, 3001, 2, "vo_minigame_1012_result_1005");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 2.99, 4, 10, 1, "すごい…あんたパーフェクトよ！\nこのままいけば次の試験、\n学年一位も夢じゃないかもね！\n楽しみだわ～♪", 11300107, 8, 5, 1, 3001, 3, "vo_minigame_1012_result_1006");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (10, 8.37, 4, 10, 1, "満点よ！　フフ、もうあんたに\n教えることはなにもないわ…！\n逆にあたしがあんたに教わりたい\nくらいよ！　…ね、先生♪", 11300108, 7, 8, 1, 3001, 3, "vo_minigame_1012_result_1007");
