INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 4.77, 4, 7, 1, "お、かなりいい点数ね～！\nあたしも教えがいがあるわ♪\nさ、まだまだ勉強するわよ！", 11300110, 1, 7, 1, 3001, 1, "vo_minigame_1012_result_1009");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2.97, 4, 7, 1, "うん、いい感じで点取れてるわ！\nこの調子で次は、\n満点を見せてほしいわね！", 11300111, 7, 8, 1, 3001, 1, "vo_minigame_1012_result_1010");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 3.47, 0, 7, 1, "あ～惜しい！\nもうちょっとで満点じゃない！\n次はパーフェクトいけるわ！\n頑張りましょ！", 11300112, 1, 5, 1, 3001, 1, "vo_minigame_1012_result_1011");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 5.32, 4, 7, 1, "すごい、かなりできてるわよ！\n難しい問題なのにやるじゃない！\nあとは目指せ、満点ね！", 11300113, 7, 8, 1, 3001, 2, "vo_minigame_1012_result_1012");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 6.49, 10, 7, 1, "うん、かなりいい感じよ！\nあんたには赤点の心配なんて\nまーったくなさそうね♪\nでも勉強はやめさせないけど！", 11300114, 7, 8, 1, 3001, 2, "vo_minigame_1012_result_1013");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 3.56, 0, 7, 1, "あーあとちょっとで\n全問正解だったのに！\n難しい問題だけどあんたなら\n次は満点狙えるわ！", 11300115, 1, 5, 1, 3001, 2, "vo_minigame_1012_result_1014");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 5.67, 10, 7, 1, "うん、ほとんど正解よ！\nこんな難しい問題なのに、\nすごいじゃない！\nやっぱりあんた只者じゃないわ！", 11300116, 1, 8, 1, 3001, 3, "vo_minigame_1012_result_1015");
