INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 3.88, 0, 7, 1, "うわー惜しいわね！\nもうちょっとで満点よ？\nま、あたしでも悩む難問だから、\nこの点数は胸を張っていいわ！", 11300118, 1, 5, 1, 3001, 3, "vo_minigame_1012_result_1017");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 4.12, 0, 4, 1, "正解率は半分くらいか～\n悪くはないんだけど、あんたなら\nこんなもんじゃないでしょ？", 11300119, 1, 3, 1, 3001, 1, "vo_minigame_1012_result_1018");
