INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 5.3, 0, 4, 1, "半分くらいの正解率か\n難しい問題だから仕方ないわね…\nでもあんたはもっとできる！\nだってあたしがついてんのよ！", 11300122, 1, 9, 1, 3001, 2, "vo_minigame_1012_result_1021");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 2.55, 0, 4, 1, "うん、そこそこできんじゃない！\n頑張って勉強して\nさらに上を目指しましょ！", 11300123, 1, 8, 1, 3001, 2, "vo_minigame_1012_result_1022");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 4.19, 0, 4, 1, "難問なのにこの正解率は\nよくやってる方よね！\nでもこんなところで\n満足してんじゃないわよ！？", 11300124, 7, 1, 1, 3001, 2, "vo_minigame_1012_result_1023");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 3.43, 0, 4, 1, "難問なのに半分くらい正解\nできてんじゃない♪\nこの調子でもっと学力\n上げていきましょ！", 11300125, 1, 7, 1, 3001, 3, "vo_minigame_1012_result_1024");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 0.0, 0, 4, 1, "よし、平均点ってとこね！\nちゃんと勉強してるみたいで\n安心したわ～♪", 11300126, 1, 1, 1, 3001, 3, "vo_minigame_1012_result_1025");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (6, 3.72, 0, 4, 1, "難問揃いでこの正解率は\n大したもんよ！\nま、もっといい点取りたいんなら\n勉強、付き合ったげるわ！", 11300127, 7, 8, 1, 3001, 3, "vo_minigame_1012_result_1026");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 3.5, 1, 1, 1, "なるほど…\nこれは教えがいがあるわね\nビシバシ鍛えてやるから\n覚悟しなさい！", 11300128, 2, 3, 1, 3001, 1, "vo_minigame_1012_result_1027");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 3.25, 1, 1, 1, "ちょっとあんた、\n全然できてないじゃない！\n…まさかこれが本気だなんて\n言わないわよね～？", 11300129, 2, 4, 1, 3001, 1, "vo_minigame_1012_result_1028");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 4.62, 0, 1, 1, "うーん……適当に答えても\nこれくらい正解できるわよ？\nちょっと本腰入れて\n教えないとね……！", 11300130, 2, 3, 1, 3001, 1, "vo_minigame_1012_result_1029");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 4.5, 0, 1, 1, "…ま、まあこの問題は\nあんたには難しすぎたのかもね\nちょっとずつでいいから、\nレベルアップしていきましょ！", 11300131, 1, 9, 1, 3001, 2, "vo_minigame_1012_result_1030");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 0.01, 9, 1, 1, "んー結構ミスっちゃってるわね…\nこのまま続けるのもいいけど、\n簡単な問題からやり直すのも\nありかもよ～？", 11300132, 3, 3, 1, 3001, 2, "vo_minigame_1012_result_1031");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 0.01, 9, 1, 1, "あらら、あんたにはちょっと\n難しすぎたかしら…？\nもう一回やり直しましょうか！", 11300133, 9, 9, 1, 3001, 2, "vo_minigame_1012_result_1032");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 0.01, 6, 1, 1, "うーん、残念な結果ね…\n超難問だから仕方ないけど\n無理せず簡単な問題から挑戦\nしてもいいかもよ？", 11300134, 3, 3, 1, 3001, 3, "vo_minigame_1012_result_1033");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 2.97, 0, 1, 1, "正解率はかなり悪いわね…\nまあ難しい問題だもんね…！\nそのチャレンジ精神は買うわ！", 11300135, 9, 3, 1, 3001, 3, "vo_minigame_1012_result_1034");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 3.1, 0, 1, 1, "なんとか０点は免れたわね…\n難問揃いだけど、\nもっと頑張っていきましょ！", 11300136, 1, 3, 1, 3001, 3, "vo_minigame_1012_result_1035");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 4.31, 1, 0, 1, "…あんたさ、０点なんて\n逆に取るの難しいわよ！？\nまさか狙ったわけじゃ\nないでしょーね～！？", 11300137, 2, 6, 1, 3001, 1, "vo_minigame_1012_result_1036");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0.1, 1, 0, 1, "０点って…\nあんたふざけてんの！？\nちゃんとやらないなら\n電撃魔法くらわせるわよ！？", 11300138, 2, 2, 1, 3001, 1, "vo_minigame_1012_result_1037");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 4.23, 9, 0, 1, "もしかしたらあんたは\n勉強向いてないのかもね…\n…勉強だけがすべてじゃないわ\n違うとこで頑張りましょ！", 11300139, 3, 9, 1, 3001, 1, "vo_minigame_1012_result_1038");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 4.38, 0, 0, 1, "怒んないから正直に言って？\n…ふざけて答えたでしょ？\nほら、正直に\n言・い・な・さ・い？", 11300140, 2, 3, 1, 3001, 2, "vo_minigame_1012_result_1039");
