INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 3.74, 10, 20, 1, "はい、よくできました！\n基礎はもう完璧ね！\n次はもっと難しい問題にも\nチャレンジしちゃいなさいよ！", 12300101, 1, 7, 2, 3001, 1, "vo_minigame_1012_result_1045");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 3.85, 0, 20, 1, "なによあんた、走り出したペンが\n止まらないって感じ？\nったくシンプルにすごいじゃない\n花丸あげるわ！", 12300102, 9, 1, 2, 3001, 1, "vo_minigame_1012_result_1046");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 0.01, 8, 20, 1, "すごい点数ね…！\nあんた勉強してないとか言って\nホントはめちゃくちゃやってる\nパターンのやつね！？", 12300103, 5, 5, 2, 3001, 1, "vo_minigame_1012_result_1047");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 2.86, 4, 20, 1, "勉強の成果、\nちゃんとでてんじゃない！\nあたしもあんたの先生として、\n鼻が高いわ～♪", 12300104, 7, 8, 2, 3001, 2, "vo_minigame_1012_result_1048");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 2.02, 9, 20, 1, "オッケー！　もう十分よ！\nこれ以上でき過ぎちゃったら、\nあたしが教える必要なくなるわ！", 12300105, 3, 5, 2, 3001, 2, "vo_minigame_1012_result_1049");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 4.46, 0, 20, 1, "難しい問題を選んだつもりなのに\nすごい正解数ね…！\nでもまだ上がある…\n次は最難関に挑戦よ！", 12300106, 1, 5, 2, 3001, 2, "vo_minigame_1012_result_1050");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 6.85, 7, 20, 1, "すごいすごいとは思ってたけど、\nあんた勉強も完璧なの…？\nそりゃみんなあんたに惚れ…\nや、な、なんでもない！！", 12300107, 4, 5, 2, 3001, 3, "vo_minigame_1012_result_1051");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 3.79, 0, 20, 1, "この問題、あたしでも悩む\n超難問なのに…\nふふっ、もう褒めるしかないわ！\n大変よくできました！", 12300108, 9, 5, 2, 3001, 3, "vo_minigame_1012_result_1052");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 0.01, 7, 20, 1, "別に顔赤くなんてなってない！\n頭がいい人が好きとか…\nかっこいいとか…\n…思ってないからね！", 12300109, 4, 4, 2, 3001, 3, "vo_minigame_1012_result_1053");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 0.0, 0, 20, 1, "スピードも正確さも完璧…\n文句なしの満点だわ！\nあんた将来、とんでもない人に\nなっちゃうんじゃない！？", 12300110, 5, 5, 2, 3001, 1, "vo_minigame_1012_result_1054");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 0.0, 0, 20, 1, "スピードも正確さも完璧…\n文句なしの満点だわ！\nあんた将来、とんでもない人に\nなっちゃうんじゃない！？", 12300112, 5, 5, 2, 3001, 2, "vo_minigame_1012_result_1054");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 0.0, 0, 20, 1, "スピードも正確さも完璧…\n文句なしの満点だわ！\nあんた将来、とんでもない人に\nなっちゃうんじゃない！？", 12300114, 5, 5, 2, 3001, 3, "vo_minigame_1012_result_1054");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (19, 3.0, 10, 15, 1, "おお～かなり正解できてるわね！\nこの調子でもっとすごい点\n目指しちゃうわよ！", 12300116, 7, 5, 2, 3001, 1, "vo_minigame_1012_result_1056");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (19, 0.01, 10, 15, 1, "うん、バッチリいい感じよ！\nちゃんと勉強してるみたいで\n関心関心♪", 12300117, 8, 8, 2, 3001, 1, "vo_minigame_1012_result_1057");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (19, 4.01, 0, 15, 1, "え、こんなにいい点取れたのに\nまだ満足してないの？\nなによその向上心…\nいいじゃない！", 12300118, 8, 5, 2, 3001, 1, "vo_minigame_1012_result_1058");
