INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (19, 0.0, 0, 15, 1, "この難易度でも\nスラスラ答えちゃうなんて…\nあんたって\nほんとすごいやつよね…！", 12300120, 10, 10, 2, 3001, 2, "vo_minigame_1012_result_1060");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (19, 3.66, 4, 15, 1, "これだけ正解できたら\n勉強も楽しいわよね♪\nさ、まだまだ続けるわよ～！", 12300121, 7, 8, 2, 3001, 2, "vo_minigame_1012_result_1061");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (19, 3.28, 0, 15, 1, "あんた、この成績\nまぐれじゃないわよね…！\nこれだけできたら\n大したもんだわ！", 12300122, 8, 5, 2, 3001, 3, "vo_minigame_1012_result_1062");
