INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (19, 3.98, 9, 15, 1, "あんた…もしかして\nあたしより点数いいかも？\nあ、あたしもあんたを見習って\n勉強しないとね…！", 12300124, 9, 5, 2, 3001, 3, "vo_minigame_1012_result_1064");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 2.51, 0, 10, 1, "うん、なかなかいい点数よ！\nでもまだまだ頑張れるわよね？\nはい、次いきましょ！", 12300131, 1, 7, 2, 3001, 1, "vo_minigame_1012_result_1067");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 4.16, 0, 10, 1, "十分優秀な成績だけど\nあんたならもっとできる！\nさ、頑張って勉強するわよ！", 12300132, 7, 1, 2, 3001, 1, "vo_minigame_1012_result_1068");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 2.07, 0, 10, 1, "うん、いい感じね！\nこの調子で少しずつ、\n正解数を増やしてくわよ！", 12300133, 7, 8, 2, 3001, 1, "vo_minigame_1012_result_1069");
