INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 0.0, 0, 10, 1, "難しい問題でも基礎は大事よ！\nこの調子でどんどん\n点数上げていきましょう！", 12300135, 1, 1, 2, 3001, 2, "vo_minigame_1012_result_1071");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 4.3, 0, 10, 1, "10問以上取れてるわね！\nえ、まだ物足りない？\nフフ、じゃあもっと上\n目指しちゃう？", 12300136, 7, 1, 2, 3001, 2, "vo_minigame_1012_result_1072");
