INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 4.24, 0, 5, 1, "ふ～ん、まあまあの出来だわ\n悪くはないんだけど…あんたには\nもっともっと期待してるわ～", 12300146, 7, 1, 2, 3001, 1, "vo_minigame_1012_result_1078");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 4.74, 0, 5, 1, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 12300147, 1, 7, 2, 3001, 1, "vo_minigame_1012_result_1079");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 0.0, 0, 5, 1, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 12300148, 1, 1, 2, 3001, 1, "vo_minigame_1012_result_1080");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2.21, 0, 5, 1, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 12300149, 1, 8, 2, 3001, 2, "vo_minigame_1012_result_1081");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2.46, 0, 5, 1, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 12300150, 1, 3, 2, 3001, 2, "vo_minigame_1012_result_1082");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2.94, 0, 5, 1, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 12300151, 1, 3, 2, 3001, 2, "vo_minigame_1012_result_1083");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 4.19, 0, 5, 1, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 12300152, 1, 7, 2, 3001, 3, "vo_minigame_1012_result_1084");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 0.0, 0, 5, 1, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 12300153, 1, 1, 2, 3001, 3, "vo_minigame_1012_result_1085");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2.63, 0, 5, 1, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 12300154, 1, 3, 2, 3001, 3, "vo_minigame_1012_result_1086");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 5.53, 0, 1, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 12300155, 1, 3, 2, 3001, 1, "vo_minigame_1012_result_1087");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 0.01, 9, 1, 1, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 12300156, 3, 3, 2, 3001, 1, "vo_minigame_1012_result_1088");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 4.15, 3, 1, 1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 12300157, 1, 3, 2, 3001, 1, "vo_minigame_1012_result_1089");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 0.01, 9, 1, 1, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 12300158, 9, 9, 2, 3001, 2, "vo_minigame_1012_result_1090");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 5.37, 0, 1, 1, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 12300159, 1, 3, 2, 3001, 2, "vo_minigame_1012_result_1091");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 1.44, 0, 1, 1, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 12300160, 1, 3, 2, 3001, 2, "vo_minigame_1012_result_1092");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 0.0, 0, 1, 1, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 12300161, 3, 3, 2, 3001, 3, "vo_minigame_1012_result_1093");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 2.91, 3, 1, 1, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 12300162, 9, 3, 2, 3001, 3, "vo_minigame_1012_result_1094");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 2.61, 0, 1, 1, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 12300163, 1, 5, 2, 3001, 3, "vo_minigame_1012_result_1095");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3.63, 1, 0, 1, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 12300164, 2, 4, 2, 3001, 1, "vo_minigame_1012_result_1096");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 4.16, 1, 0, 1, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 12300165, 2, 6, 2, 3001, 1, "vo_minigame_1012_result_1097");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0.01, 6, 0, 1, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 12300166, 3, 3, 2, 3001, 1, "vo_minigame_1012_result_1098");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 5.75, 0, 0, 1, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 12300167, 2, 6, 2, 3001, 2, "vo_minigame_1012_result_1099");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 5.64, 1, 0, 1, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 12300168, 2, 4, 2, 3001, 2, "vo_minigame_1012_result_1100");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 5.73, 8, 0, 1, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 12300169, 4, 8, 2, 3001, 2, "vo_minigame_1012_result_1101");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 5.32, 1, 0, 1, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 12300170, 3, 5, 2, 3001, 3, "vo_minigame_1012_result_1102");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2.37, 9, 0, 1, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 12300171, 9, 3, 2, 3001, 3, "vo_minigame_1012_result_1103");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 4.25, 3, 0, 1, "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 12300172, 1, 9, 2, 3001, 3, "vo_minigame_1012_result_1104");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0.0, 0, 0, 1, "さ、勉強を始めるわよ", 13100101, 7, 7, 3, 1001, 0, "vo_minigame_1012_gamestart_100");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0.0, 0, 0, 1, "よし、勉強の成果を見てやるわ！", 13100102, 1, 1, 3, 1001, 0, "vo_minigame_1012_gamestart_101");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 1.82, 0, 0, 1, "じゃあ試験するわよ。はい教科書閉じて！", 13100103, 7, 1, 3, 1001, 0, "vo_minigame_1012_gamestart_102");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 0.01, 4, 3, 1, "やる気マンマンじゃない！", 13100201, 8, 8, 3, 1002, 0, "vo_minigame_1012_gamestart_103");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 0.0, 0, 3, 1, "よし、じゃあもう一回やるわよ！", 13100202, 1, 1, 3, 1002, 0, "vo_minigame_1012_gamestart_104");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (1, 0.0, 0, 1, 1, "普通の難易度よ！", 13100301, 0, 0, 3, 1003, 0, "vo_minigame_1012_gamestart_105");
