INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3, 0.0, 0, 3, 1, "あたしでも手こずる難問揃いよ…！", 13100305, 5, 5, 3, 1003, 0, "vo_minigame_1012_gamestart_109");
