INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 2.31, 11, 20, 2, "点数イケイケじゃん！　\nもしかして、ヒデサイには\n簡単過ぎた感じ？", 22300102, 2, 3, 2, 3001, 1, "vo_minigame_1012_result_2046");
