INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 4.33, 11, 20, 2, "ムズい問題なのに\n〇でいっぱいじゃん…！\nさっすが、ヒデサイセンセー！", 22300104, 7, 6, 2, 3001, 2, "vo_minigame_1012_result_2048");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 5.73, 0, 20, 2, "一緒にベンキョー\nしてるだけなのに\nうちまで賢くなった気する…！\nマジありがとね", 22300105, 2, 6, 2, 3001, 2, "vo_minigame_1012_result_2049");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 0.01, 8, 20, 2, "これってムズい問題だよね？\nなんで簡単に解いてくの？\nヒデサイ、すごすぎ！", 22300106, 6, 6, 2, 3001, 2, "vo_minigame_1012_result_2050");
