INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 4.6, 4, 20, 2, "これだけ教えてもらったら\nもうテストもよゆーっしょ！\nヒデサイ、マジありがとね♪", 22300109, 3, 2, 2, 3001, 3, "vo_minigame_1012_result_2053");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 5.57, 0, 20, 2, "うちこんなの初めて見た…！\nヒデサイセンセー、神ってる！\nそだ、記念にこれ飾っとこうよ♪\nえ、それはちょっち恥ずかしい？", 22300110, 10, 6, 2, 3001, 1, "vo_minigame_1012_result_2054");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (-1, 5.57, 0, 20, 2, "うちこんなの初めて見た…！\nヒデサイセンセー、神ってる！\nそだ、記念にこれ飾っとこうよ♪\nえ、それはちょっち恥ずかしい？", 22300112, 10, 6, 2, 3001, 2, "vo_minigame_1012_result_2054");
