INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (19, 3.23, 11, 15, 2, "ヒデサイ、〇でいっぱいじゃん♪\nうちも教えてもらったとこは\nけっこー覚えてきたかも？", 22300118, 2, 3, 2, 3001, 1, "vo_minigame_1012_result_2058");
