INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 0.0, 0, 10, 2, "きゃはっ、いい感じ！\nたくさん解けてるし\nベンキョーの成果\n…ってやつだね♪", 22300131, 3, 3, 2, 3001, 1, "vo_minigame_1012_result_2067");
