INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 2.28, 0, 10, 2, "けっこー解けたよね？\nやっぱ〇増えると\nバイブス上がる～", 22300133, 2, 10, 2, 3001, 1, "vo_minigame_1012_result_2069");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 0.0, 0, 10, 2, "ベンキョーってあれだね\nわかった気すると\nまあまあたのしーかも！", 22300134, 2, 2, 2, 3001, 2, "vo_minigame_1012_result_2070");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 2.1, 0, 10, 2, "10個以上解けてる！？\nけっこーいいペースだよね？\nいい調子、いい調子～", 22300135, 2, 6, 2, 3001, 2, "vo_minigame_1012_result_2071");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 2.13, 0, 10, 2, "けっこー解けてる！\nムズい問題もヒデサイと\n一緒なら怖くないね♪", 22300136, 3, 2, 2, 3001, 2, "vo_minigame_1012_result_2072");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 0.0, 0, 10, 2, "おにムズ問題でも教えるの\n超やさしーし、マジ感謝！\n一緒にがんばろーね♪", 22300137, 7, 7, 2, 3001, 3, "vo_minigame_1012_result_2073");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 0.0, 0, 10, 2, "おにムズなのに\n〇けっこーあるし\nヒデサイすごくない？", 22300138, 6, 6, 2, 3001, 3, "vo_minigame_1012_result_2074");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (14, 4.21, 0, 10, 2, "おにムズでこのペースは\nすごいんじゃ…？\nうちもがんばってついてくね！", 22300139, 5, 6, 2, 3001, 3, "vo_minigame_1012_result_2075");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 1.94, 0, 5, 2, "悪くないよね？\nでもでも\nヒデサイとうちなら\nもっとできる気する！", 22300146, 3, 0, 2, 3001, 1, "vo_minigame_1012_result_2078");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2.28, 0, 5, 2, "もっと〇ほしーね…\n地道にやるしか\nないっぽいし\nもっかい教えてくれる？", 22300147, 0, 4, 2, 3001, 1, "vo_minigame_1012_result_2079");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 0.0, 0, 5, 2, "ベンキョーしたけど\nわかんないとこばっか…\nヒデサイセンセー、助けて～", 22300148, 4, 4, 2, 3001, 1, "vo_minigame_1012_result_2080");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2.67, 0, 5, 2, "やっぱムズかったね…\nでも次はもうちょい\nできそーな気がするよ！", 22300149, 3, 4, 2, 3001, 2, "vo_minigame_1012_result_2081");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 4.68, 0, 5, 2, "問題ムズいし、この点数は\nありよりのありっしょ？\nえ、もっとできた感じ？", 22300150, 6, 10, 2, 3001, 2, "vo_minigame_1012_result_2082");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 0.0, 0, 5, 2, "どこ間違ったんだろ？\nうちさっぱりだった…\nやっぱムズいだけあるね", 22300151, 9, 9, 2, 3001, 2, "vo_minigame_1012_result_2083");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 3.55, 0, 5, 2, "激ムズだけど\nやることは一緒だよね？\nうちもヒデサイについてくから\nコツコツがんばろ！", 22300152, 3, 0, 2, 3001, 3, "vo_minigame_1012_result_2084");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 2.51, 0, 5, 2, "やっぱおにムズだね…\nそだ、迷ったら\nヒント使うのも\nありよりのあり？", 22300153, 6, 4, 2, 3001, 3, "vo_minigame_1012_result_2085");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (9, 6.15, 0, 5, 2, "やっぱテストって\nなんとなくじゃ無理？\n覚えるしかないの？\nじゃあがんばるしかないね…", 22300154, 5, 9, 2, 3001, 3, "vo_minigame_1012_result_2086");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 4.12, 6, 1, 2, "できたと思ったけど\nそーじゃなかった系？\nテストってマジきびしー…", 22300155, 9, 4, 2, 3001, 1, "vo_minigame_1012_result_2087");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 0.01, 6, 1, 2, "うーん…さっぱり！\nでも簡単な問題なんだよね…？\nもっかいやってみる？", 22300156, 4, 4, 2, 3001, 1, "vo_minigame_1012_result_2088");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 5.28, 0, 1, 2, "うちらまだまだ\nベンキョーちうだし…\nこれからだよねっ？\nね、ヒデサイ！", 22300157, 3, 0, 2, 3001, 1, "vo_minigame_1012_result_2089");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 2.89, 0, 1, 2, "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！", 22300158, 3, 0, 2, 3001, 2, "vo_minigame_1012_result_2090");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 5.45, 0, 1, 2, "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？", 22300159, 7, 0, 2, 3001, 2, "vo_minigame_1012_result_2091");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 4.29, 3, 1, 2, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 22300160, 10, 4, 2, 3001, 2, "vo_minigame_1012_result_2092");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 4.64, 6, 1, 2, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 22300161, 8, 4, 2, 3001, 3, "vo_minigame_1012_result_2093");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 3.14, 0, 1, 2, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 22300162, 5, 9, 2, 3001, 3, "vo_minigame_1012_result_2094");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (4, 6.59, 0, 1, 2, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 22300163, 4, 7, 2, 3001, 3, "vo_minigame_1012_result_2095");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0.0, 0, 0, 2, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 22300164, 3, 3, 2, 3001, 1, "vo_minigame_1012_result_2096");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2.2, 5, 0, 2, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 22300165, 10, 9, 2, 3001, 1, "vo_minigame_1012_result_2097");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0.01, 6, 0, 2, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 22300166, 4, 4, 2, 3001, 1, "vo_minigame_1012_result_2098");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2.8, 3, 0, 2, "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！", 22300167, 2, 6, 2, 3001, 2, "vo_minigame_1012_result_2099");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3.22, 6, 0, 2, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 22300168, 4, 9, 2, 3001, 2, "vo_minigame_1012_result_2100");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2.1, 11, 0, 2, "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", 22300169, 0, 4, 2, 3001, 2, "vo_minigame_1012_result_2101");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 2.74, 3, 0, 2, "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！", 22300170, 2, 0, 2, 3001, 3, "vo_minigame_1012_result_2102");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 3.0, 9, 0, 2, "ヒデサイでも\nおにムズな感じ？\nじゃあ、このテスト\n誰も解けなくない？", 22300171, 9, 6, 2, 3001, 3, "vo_minigame_1012_result_2103");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 4.37, 0, 0, 2, "…あれ？\n０が〇に見えてきた！\nきゃはっ、ちょっち\nやる気出てきたかも！", 22300172, 2, 10, 2, 3001, 3, "vo_minigame_1012_result_2104");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0.01, 10, 0, 2, "よーし、がんばるぞー", 23100101, 0, 0, 3, 1001, 0, "vo_minigame_1012_gamestart_200");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0, 0.0, 0, 0, 2, "ベンキョー、\nベンキョー！", 23100102, 2, 2, 3, 1001, 0, "vo_minigame_1012_gamestart_201");
